win 服务集成组件代码如下：
/// <summary>
/// 应用程序的主入口点。
/// </summary>
     [RunInstaller(true)]
     public class Program : System.Utility.Commons.Core.ServiceBaseInstaller
     {
    public     static void Main(string[] args)
        {
            using (Program setting = new Program())
            {
                setting.RunService<Service1>(args);
            }
        }
     }
//下面是配置文件中的设置
  <appSettings>
    <!--本服务的名称-->
    <add key="InstallerServiceName" value="WinServices.ServiceTest" />
    <!--本服务的显示名称-->
    <add key="InstallerDisplayName" value="WinServices.ServiceTest" />
  </appSettings>

作业任务调度框架引擎组件
具有以下特性：
1、多线程并发运行多个作业任务
2、日志记录调度器监听、作业任务监听
3、支持cron表达式
4、实现简单集成服务
如：
    public partial class Service1 : JobEngineServiceBase
    {
        public Service1()
        {
            InitializeComponent();
        }
    }

